const request = require('supertest');
const app = require('../index'); // Import your Express app
const mongoose = require('mongoose');
const User = require('../models/User');
const Adventure = require('../models/Adventure');

let token;

beforeAll(async () => {
  await mongoose.connect(process.env.MONGO_URI);

  // Register and login to get a token for authenticated routes
  const res = await request(app)
    .post('/api/auth/register')
    .send({ name: 'Test User', email: 'test@example.com', password: 'password' });

  const loginRes = await request(app)
    .post('/api/auth/login')
    .send({ email: 'test@example.com', password: 'password' });

  token = loginRes.body.token;
});

afterAll(async () => {
  await mongoose.connection.close();
});

describe('User Profile', () => {
  it('should get user profile', async () => {
    const res = await request(app)
      .get('/api/profile')
      .set('Authorization', `Bearer ${token}`);

    expect(res.statusCode).toBe(200);
    expect(res.body).toHaveProperty('name', 'Test User');
    expect(res.body).toHaveProperty('email', 'test@example.com');
  });

  it('should update user profile', async () => {
    const res = await request(app)
      .put('/api/profile')
      .set('Authorization', `Bearer ${token}`)
      .send({ name: 'Updated User', email: 'updated@example.com' });

    expect(res.statusCode).toBe(200);
    expect(res.body).toHaveProperty('name', 'Updated User');
    expect(res.body).toHaveProperty('email', 'updated@example.com');
  });

  it('should handle invalid user profile updates', async () => {
    const res = await request(app)
      .put('/api/profile')
      .set('Authorization', `Bearer ${token}`)
      .send({ email: '' });

    expect(res.statusCode).toBe(400); // Or the status code your validation returns
  });

    it('should save an adventure to user profile', async () => {
        const adventure = await Adventure.create({ name: 'Test Adventure' });

        const res = await request(app)
        .post('/api/profile/save-adventure')
        .set('Authorization', `Bearer ${token}`)
        .send({ adventureId: adventure._id });

        expect(res.statusCode).toBe(200);
        expect(res.body.favorites).toContain(adventure._id.toString());
    });
});

