// routes/adminRoutes.js
const express = require('express');
const router = express.Router();
const { protect, admin, superAdmin } = require('../middleware/authMiddleware');
const {
  getAllUsers,
  deleteUser,
  getAllAdventures,
  createAdventure,
  updateAdventure,
  deleteAdventure,
  getAllBookings,
  getAllProviders,
  deleteProvider,
  makeAdmin,
